import math


class Solution(object):
    ##simply swap the current indexed value with the index where it should be
    def minimumSwaps(self, arr):
        min_swap = 0
        i = 0
        while i < len(arr):
            if arr[i] != i + 1:
                swap(arr, i, arr[i] - 1)
                min_swap = min_swap + 1
            else:
                i = i + 1
        return min_swap


def swap(arr, m, n):
    temp = arr[m]
    arr[m] = arr[n]
    arr[n] = temp


